const countries = [
    { name: 'Isreal', capital: 'Jerusalem'},
    { name: 'France', capital: 'Paris'},
    { name: 'Italy', capital: 'Rome'},
    { name: 'England', capital: 'London'},
    { name: 'Vietnam', capital: 'Hanoi'}
]

export default countries;
